--
-- Name: new_count_product(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.new_count_product() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
update product
set count = (product.count - orderproduct.count)
FROM orderproduct 
where product.idproduct = orderproduct.idproduct;
return NEW;
END;
$$;


